BEGIN TRANSACTION;
CREATE TABLE [Floors] (
[id] INTEGER  NOT NULL PRIMARY KEY ,
[name] vARCHAR(100)  NOT NULL,
[description] teXT  NULL,
[from_number] varCHAR(100)  NULL,
[to_number] varCHAR(100)  NULL,
[library_id] inTEGER  NULL
);
CREATE TABLE [Stacks] (
[id] INTEGER  PRIMARY KEY  NOT NULL,
[number] inTEGER  NOT NULL,
[number_url] vARCHAR(256)  NULL,
[begins_with] varCHAR(40)  NULL,
[ends_with] vaRCHAR(40)  NULL,
[map_coords] vaRCHAR(40)  NULL,
[map_url] vARCHAR(256)  NULL,
[map_id] inTEGER  NULL,
[floor_id] iNTEGER  NOT NULL
);
CREATE TABLE [Libraries] (
[id] INTEGER  PRIMARY KEY  NOT NULL,
[name] VARCHAR(100)  UNIQUE NULL,
[description] text  NULL
);
COMMIT;
